import {View, Text, ScrollView, StyleSheet} from 'react-native';
import React from 'react';
import CategoryCard from './CategoryCard';

const Categories = () => {
  const categories = [
    {
      id: 1,
      imageUrl:
        'data:image/jpeg;base64,',
      title: 'Offers',
    },
    {
      id: 2,
      imageUrl:
        'data:image/jpeg;base64,',
      title: 'Pizza',
    },
    {
      id: 3,
      imageUrl:
        'https://www.seriouseats.com/thmb/83AO2fhz_nvt1fg2SXIyJYujIfY=/1500x1125/filters:fill(auto,1)/20210928-Som-Tum-Thai-green-papaya-salad-vicky-wasik-27-9e282292baea439d81ee86643763c86c.jpg',
      title: 'Thai',
    },
    {
      id: 4,
      imageUrl:
        'data:image/jpeg;base64,',
      title: 'Sushi',
    },
    {
      id: 5,
      imageUrl:
        'data:image/jpeg;base64,',
      title: 'Asian',
    },
    {
      id: 6,
      imageUrl:
        'data:image/jpeg;base64,',
      title: 'Desi',
    },
  ];

  return (
    <ScrollView horizontal showsHorizontalScrollIndicator={false}>
      {categories.map(category => (
        <CategoryCard
          imageUrl={category.imageUrl}
          title={category.title}
          key={category.id}
        />
      ))}
    </ScrollView>
  );
};

const styles = StyleSheet.create({});

export default Categories;
